    "2015-12-20T18:35:58.550799",nt"name": "pacioos-water-quality-buoy-kn-wqb-kn-kilo-nalu-oahu-hawaii",nt"isopen":
    false,nt"url": null,nt"notes": "The water quality buoys are part of the
    Pacific Islands Ocean Observing System (PacIOOS) and are designed to measure a variety
    of ocean parameters at fixed points. WQB-KN is located at the Kilo Nalu Nearshore
    Reef Observatory, near Kakaako Waterfront Park and Kewalo Basin off of Ala Moana
    Boulevard in Honolulu. Continuous sampling of this area provides a record of baseline
    conditions of the chemical and biological environment for comparison when there
    are pollution events such as storm runoff or a sewage spill.",nt"license_title":
